ie Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",nzc='Dimension',Pkc='Dimension [height=',Cvc='DirectionalTextHelper',Fvc='DockLayoutPanel',Gvc='DockLayoutPanel$Direction',Hvc='DockLayoutPanel$Direction;',Kvc='DockLayoutPanel$DockAnimateCommand',Ivc='DockLayoutPanel$LayoutData',Rrc='DomEvent',Wrc='DomEvent$Type',Xxc='Double',Ohc='EAST',tcc='EEE, d MMM yyyy HH:mm:ss Z',Hnc='EEE. dd MMM. yyyy HH:mm:ss',tdc='EEEE MMMM d',Udc='EEEE, MMMM d',Qdc='EEEE, MMMM d, y',pdc='EEEE, y MMMM dd',U9b='EM',Rfc='EMPTY',Wfc='ENABLED',mec='END',W9b='EX',kuc='ElementMapperImpl',luc='ElementMapperImpl$FreeNode',Pdc='English',brc='Enum',Gdc='Etc/GMT',Idc='Etc/GMT+',Hdc='Etc/GMT-',nac='Event type',bxc='Event$NativePreviewEvent',hsc='EventBus',rqc='EventObject',wqc='Exception',sgc='Expecting version 6 from server, got ',kbc='F',Qlc='F8834F07517EF3B7D02B9E845E5E1B88',P9b='FIXED',Qgc='FLOAT',vlc='Fail: ',Ebc='Feb',sbc='February',kpc='Female',Yxc='Float',Lvc='FlowPanel',jvc='FocusWidget',Qjc='For input string: "',gcc='Fri',_bc='Friday',Bac='GET',Ync='GGD55XLBAH',Ipc='GGD55XLBAJ',Voc='GGD55XLBBI',Xnc='GGD55XLBCH',Xoc='GGD55XLBCI',sfc='GGD55XLBDB',Wnc='GGD55XLBDH',Rpc='GGD55XLBDJ',Eoc='GGD55XLBDK',ffc='GGD55XLBEB',Unc='GGD55XLBEH',Woc='GGD55XLBEI',Jpc='GGD55XLBEJ',tfc='GGD55XLBFB',_nc='GGD55XLBFH',spc='GGD55XLBFI',iqc='GGD55XLBFK',ppc='GGD55XLBGI',gqc='GGD55XLBGK',wfc='GGD55XLBHB',hoc='GGD55XLBHH',dpc='GGD55XLBHI',fqc='GGD55XLBHK',joc='GGD55XLBIH',cqc='GGD55XLBIK',ioc='GGD55XLBJH',enc='GGD55XLBJJ',hqc='GGD55XLBJK',uoc='GGD55XLBKG',Qoc='GGD55XLBKH',tpc='GGD55XLBKI',Zpc='GGD55XLBKK',roc='GGD55XLBLG',Poc='GGD55XLBLH',lpc='GGD55XLBLI',$pc='GGD55XLBLK',yoc='GGD55XLBMG',Ooc='GGD55XLBMH',inc='GGD55XLBMJ',woc='GGD55XLBNG',Noc='GGD55XLBNH',Ypc='GGD55XLBNK',Lmc='GGD55XLBOG',Roc='GGD55XLBOH',Anc='GGD55XLBOJ',Mmc='GGD55XLBPG',fpc='GGD
